import React from 'react'
import Logo from '../../assets/white-logo.png'
import { useState } from 'react'
// import {AiOutlineHome, AiOutlineUser} from 'react-icons/ai'
// import {BiBook} from 'react-icons/bi'
// import {RiServiceLine} from 'react-icons/ri'
// import {BiMessageSquareDetail} from 'react-icons/bi'
// import {FaStackOverflow} from 'react-icons/fa'

const HeaderNav = () => {
    const [activeHeadNav, setActiveHeadNav] = useState('#')
  return (
    <nav id='nav'>
        <div className="header__nav-content">
            <img src={Logo} alt="logo" />
            <ul className="header__nav-menu">
                <li className="header__nav-item">
                    <a href="#" onClick={() => setActiveHeadNav('#')} className={activeHeadNav === '#' ? 'active' : ''}>Home</a> 
                    {/* <AiOutlineHome className='header__nav-item-icon'/>  */}
                </li>
                <li className="header__nav-item">
                    <a href="#about" onClick={() => setActiveHeadNav('#about')} className={activeHeadNav === '#about' ? 'active' : ''}>About</a> 
                    {/* <AiOutlineUser className='header__nav-item-icon'/>  */}
                </li>
                <li className="header__nav-item">
                    <a href="#experience" onClick={() => setActiveHeadNav('#experience')} className={activeHeadNav === '#experience' ? 'active' : ''}>Experience</a> 
                    {/* <BiBook className='header__nav-item-icon'/>  */}
                </li>
                <li className="header__nav-item">
                    <a href="#services" onClick={() => setActiveHeadNav('#services')} className={activeHeadNav === '#services' ? 'active' : ''}>Services</a> 
                    {/* <RiServiceLine className='header__nav-item-icon'/>  */}
                </li>
                <li className="header__nav-item">
                    <a href="#projects" onClick={() => setActiveHeadNav('#projects')} className={activeHeadNav === '#projects' ? 'active' : ''}>Projects</a> 
                    {/* <FaStackOverflow className='header__nav-item-icon'/>  */}
                </li>
                <li className="header__nav-item">
                    <a href="#contact" onClick={() => setActiveHeadNav('#contact')} className={activeHeadNav === '#contact' ? 'active' : ''}>Contact</a> 
                    {/* <BiMessageSquareDetail className='header__nav-item-icon'/>  */}
                </li>
            </ul>

            <div className='hamburger'>
                <span className='bar'></span>
                <span className='bar'></span>
                <span className='bar'></span>
            </div>
        </div>
    </nav>
  )
}

export default HeaderNav
